import React from "react";

const App = () => {
  return (
    <div className="full-container">
      <aside className="side-bar"></aside>
      <main className="main">
        <section className="hero">
          <h2>Hi there, I'm</h2>
          <h1>Kushal Nandwani</h1>
          <h2>Front-End Web Developer</h2>
          <br />
          <br />
          <br />
          <p>I am passionate </p>
        </section>
      </main>
    </div>
  );
};

export default App;
